export const baseurl = "http://127.0.0.1:5000/api/";
export const transapi = baseurl+"data_save";
export const getapi = baseurl+"load_img_data";
export const imgapi = baseurl+"images/";
export const header={
    "Headers":{
        "Content-Type":"application/json",
        "Accept":"application/json"
    }
}
